import { Button, Alert, Navbar } from 'react-bootstrap';
import "./Home.css";

function Home() {
    return (
      <div className="home">
        <div className="mt-3 bubble-light">
            <Link to="/comps" className="btn btn-primary rounded-pill button-style"> Substances </Link>
            <Link to="/elo" className="btn btn-primary rounded-pill ms-3 button-style"> Treatment Centers </Link>
            <Link to="/cities" className="btn btn-primary rounded-pill ms-3 button-style"> City Statistics </Link>
            <Link to="/about" className="btn btn-primary rounded-pill ms-3 button-style"> About </Link>
        </div>
        <Button>Comps</Button>
        <Button>ELO</Button>
        <Button>Teams</Button>
      </div>
    );
  }

  export default Home;
